const Imagen = {
    imgnovia: ImgNovia,
    imgnadando: ImgNadando,
    imgrisco: ImgRisco,
    imgplaya: ImgPlaya,
    imgcatarata: ImgCatarata,
    imgneblina: ImgNeblina,
    imgparis: ImgParis,
    imgbosque: ImgBosque,
    imgrisco2:ImgRisco2
};

const Icons ={
    iconFacebook:IconFacebook,
    iconInstagram:IconInstagram,
    iconSnapchat:IconSnapchat,
    iconPinterest:IconPinterest,
    icontwitter:Icontwitter,
    Icontwitter:Icontwitter,
};

export const themes = {
